ony pulls, yell at the TV and surround himself with good company. I'm glad he's still kicking around. All full of piss and vinegar. I miss you and love you! Can't wait to see you later this year \u2665\ufe0f\n.\n.\n.\n#grandparents #Vermont #vermonta #fisherman #newengland #flannel #grandpa #wade #country #fishing #love #family #vermonter #instagood"}}]},"shortcode":"B9xtxMjg0aL","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584323640,"dimensions":{"height":1350,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90049576_683110715825688_3175023211068894272_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=u8KF46U4-ooAX8XzhYH\u0026oh=7422bae7024115d005954eb552e557ae\u0026oe=5EA2C921","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"49022981"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.112.900.900a/s640x640/90049576_683110715825688_3175023211068894272_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=u8KF46U4-ooAX8XzhYH\u0026oh=ee0818bd66d0bf9d45e7a964796047ff\u0026oe=5EA13192","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.112.900.900a/s150x150/90049576_683110715825688_3175023211068894272_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=u8KF46U4-ooAX8XzhYH\u0026oh=7f678016c00e40e54e31047ba242560d\u0026oe=5EA0E2FA","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.112.900.900a/s240x240/90049576_683110715825688_3175023211068894272_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=u8KF46U4-ooAX8XzhYH\u0026oh=82215dcadac30c6833fdcdd9ed2b1a3a\u0026oe=5EA6F4B0","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.112.900.900a/s320x320/90049576_683110715825688_3175023211068894272_n.jpg?_nc
